// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;
import AwLayoutSlot from 'viewmodel/AwLayoutSlotViewModel';
import CommonHeaderContent from 'viewmodel/CommonHeaderContentViewModel';




/*
ctx imports
*/

const ctxImportObj = {  };




/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {},
    "lifecycleHooks": {},
    "i18n": {
        "APPLICATION_HEADER": [
            "BaseMessages"
        ]
    },
    "props": {
        "sub-panel-context": {
            "type": "object"
        }
    },
    "_viewModelId": "CommonHeader",
    "_uniqueViewModelId": "CommonHeader",
    "ctx": {}
};

/*
<header aria-label="i18n.APPLICATION_HEADER" class='sw-row sw-header align-center'>
    <div class='sw-column flex-auto'><aw-layout-slot name='aw_headerTitle' context="props.subPanelContext"></aw-layout-slot></div>
    <div class='flex-shrink'><common-header-content></common-header-content></div>
</header>

*/
const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <header aria-label={i18n.APPLICATION_HEADER} className="sw-row sw-header align-center">
        <div className="sw-column flex-auto">
            <AwLayoutSlot name="aw_headerTitle" context={AwParseService.instance( "props.subPanelContext" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
            </AwLayoutSlot>
        </div>
        <div className="flex-shrink">
            <CommonHeaderContent>
            </CommonHeaderContent>
        </div>
    </header>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
